import { Pressable, Text, View } from "react-native";

const CatFoodBowl = ({catFood, onPress}) =>{

    return(
        <View style={{flexDirection: 'row', alignItems: 'center', justifyContent: 'space-evenly'}}>
            <Pressable disabled={catFood==0} onPress={onPress}>
                <View>
                    {catFood===0 ? 
                    <Text style={{fontSize:25}}>\______/</Text>
                    :
                    <>
                    <Text style={{fontSize:20}}>⣾⣿⣿⣿⣿⣷</Text>
                    <Text style={{fontSize:25}}>\_____/</Text>
                    </>}
                </View>
            </Pressable>
            <View>
                <Text> {catFood} catfood remain ╭(°A°`)╮</Text>
            </View>
        </View>
    )
}

export default CatFoodBowl;
